void cleanup(http_conn* conn) {
  if (conn->fd < 0) return; // Guard
  timer_cancel(conn->timer_id);
  reactor_deregister(r, conn->fd);
  wbuf_free(&conn->wbuf);
  close(conn->fd);
  free(conn);
}

